import "./UserProfile.css"

const UsersProfile =() =>{
    return(
        <div className="box">
            <p>Name: John Doe</p>
            <p>Age : 25</p>
            <p>Contact: 9876543210</p>
            <p>Email Id</p>
            <p>Gender</p>
            <p>Rating</p>
        </div>
    )
}

export default UsersProfile;
